      | 47705 -> { ItemTypeData.id= 47705; name= "Expired Basic X-Sense 'Consciousness' Cerebral Accelerator"; published= false; description= "The Society of Conscious Thought has developed a large variety of technologies and techniques for enhancing the uptake of knowledge. The Society's X-Sense corporation manufactures a variety of medical devices and legal boosters, including some of the SoCT's cerebral accelerator designs.    Cerebral accelerators are military grade boosters that significantly increase a pilot's skill development for a given window of time. This is achieved by priming the user's brain and neural pathways for increased data bandwidth during knowledge transfer.    Capsuleers using this accelerator can expect a massive increase in neural bandwidth, aiding much more rapid transfer of neural data from skill packs."; marketGroupId= None; groupId= 303; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 1890; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 2422; value= 17688.458333 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 330; value= 86400000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 175; value= 6.000000 }; { DogmaAttributeValueData.attributeId = 176; value= 6.000000 }; { DogmaAttributeValueData.attributeId = 177; value= 6.000000 }; { DogmaAttributeValueData.attributeId = 178; value= 6.000000 }; { DogmaAttributeValueData.attributeId = 179; value= 6.000000 }; { DogmaAttributeValueData.attributeId = 277; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 182; value= 3402.000000 }; { DogmaAttributeValueData.attributeId = 1916; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 1087; value= 10.000000 } |]; dogmaEffects= [| { DogmaEffectValueData.effectId = 302; is