      | 47802 -> { ItemTypeData.id= 47802; name= "Unstable Medium Shield Extender Mutaplasmid"; published= true; description= "This bioadaptive mutaplasmid tool is designed to interface with and alter supplemental shield enhancement systems. As such this mutaplasmid could be used to mutate the performance characteristics of most shield extenders in the correct size class.    Triglavian bioadaptive technology makes extensive use of engineered colonies of extremophilic bacteria, that are used to grow, harvest and adapt various resources found in Abyssal Deadspace. Artificial colonizing plasmids integrated into specialist tools used for direct adaptation of technology can be found in Triglavian caches in various stages of development. These mutaplasmids can be used to alter the characteristics of a wide variety of equipment types, depending on the strain and the bioadaptive tool with which they are integrated.    The mutaplasmid colony integrated into this bioadaptive tool is highly unstable, with a high rate of reproduction and mutation. The mutational benefits of using this mutaplasmid are potentially very high but the risks are also extreme."; marketGroupId= Some(2447); groupId= 1964; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 1.000000; portionSize= 1; radius= 1.000000; volume= 1.000000 } |> Some
      | 47899 -> { ItemTypeData.id= 47899; name= "Chaotic Firestorm Filament"; published= true; description= "This Abyssal Filament will pull a <b>Tech I or Tech II Cruiser</b> into a pocket of Abyssal Deadspace experiencing <b>chaotic and destabilizing effects</b>, and blasted by plasma firestorms that will <b>reduce Thermal resistance</b> but <b>enhance ship armor strength</b>.    <b><color=yellow>Warning:</color></b> Abyssal Deadspace is a particularly harsh and unforgiving environment. Entanglement of the warp core with a space-time filament introduces severe deformations of the ship's warp field that cumulatively increase over time. After <b><color=yellow>20 minutes</color></b> catastrophic collapse of the warp field is predicted, with <b><color=yellow>destruction of the ship and capsule</color></b> certain.    A device of Triglavian design that functions as one end of an energetically inert filament of space-time connected to a specific pocket of Abyssal Deadspace. When activated by a ship equipped with a warp core that has the correct mass-energy parameters, the filament becomes a conduit that will draw the activating vessel along it and into the connected deadspace pocket.     The mass-energy exchange involved leaves a highly energetic trace at the ship's origin point and the space-time filament remains entangled with the warp core of the ship that uses it. Triglavian Transfer Conduits will permit such a ship to progress through the deadspace pocket but an Origin Conduit will return the ship to its starting location in normal space."; marketGroupId= Some(2459); groupId= 1979; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 0.100000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 2760; value= 47864.000000 }; { DogmaAttributeValueData.attributeId = 2761; v